export class PopupErrorBuilder {
  constructor() {
    this.mensagens = [];
  }
  adicionarMensagem(mensagem) {
    if (mensagem && !this.mensagens.includes(mensagem)) {
      this.mensagens.push(mensagem);
    }
    return this;
  }
  temMensagens() {
    return this.mensagens.length > 0;
  }
  construir() {
    return [...this.mensagens];
  }
}
